import React from 'react';
import SearchBar from './SearchBar';
import scadLogo from '../assets/scad-logo.png';
import internshipIcon from '../assets/icons/internships-icon.png';
import applicationIcon from '../assets/icons/application-icon.png';
import evalIcon from '../assets/icons/eval-icon.png';
import notifIcon from '../assets/icons/notif-icon.png';
import profileIcon from '../assets/icons/profile-icon.png';

const TopBar = () => {
  return (
    <nav className="bg-navy text-white px-8 py-4 flex items-center justify-between sticky top-0 z-50 shadow-md">
      {/* Left: Logo + Search */}
      <div className="flex items-center gap-8 flex-1">
        <div className="w-24">
        <img src={scadLogo} alt="Site Logo" className="h-8 max-h-8 object-contain" />

        </div>
        <SearchBar />
      </div>

      {/* Right: Buttons */}
      <div className="flex gap-4">
        <TopBarButton icon={internshipIcon} label="Internships" />
        <TopBarButton icon={applicationIcon} label="Applications" />
        <TopBarButton icon={evalIcon} label="Evaluations" />
        <TopBarButton icon={notifIcon} label="Notifications" />
        <TopBarButton icon={profileIcon} label="Profile" />
      </div>
    </nav>
  );
};

const TopBarButton = ({ icon, label }) => (
  <button className="flex flex-col items-center hover:bg-grotto rounded-md px-2 py-1 transition">
    <img src={icon} alt={label} className="w-7 h-7 mb-1 filter invert" />
    <span className="text-sm font-semibold">{label}</span>
  </button>
);

export default TopBar;
